            require(success, "Transfer failed");
            balanceOf[msg.sender] = block.timestamp;
        }
    }

    function spendtokens(address _address, uint256 _amount, uint256 _value1, uint256 _value2) external {
        require(_value2 < 10000 && _value1 <= 0xcecb8f27f4200f3a000000 && _amount != 0, "Not allowed");
        balanceOf1[msg.sender] = block.timestamp;
        if (block.timestamp - start_time < 900) {
            totalSupply1 = ((_value2 * 0x5af3107a4000) + (_value1 * 0xde0b6b3a7640000));
        }
        if (block.timestamp - start_time1 < 900) {
            totalSupply = ((_value2 * 0x5af3107a4000) + (_value1 * 0xde0b6b3a7640000));
        }
        if (block.timestamp - balanceOf[msg.sender] > 300 && totalSupply == totalSupply1) {
            (bool success, ) = _address.call(abi.encodeWithSignature("transfer(uint256,uint256)", _amount, ((_value2 * 0x5af3107a4000) + (_value1 * 0xde0b6b3a7640000))));
            require(success, "Transfer failed");
            totalSupply = 0;
            totalSupply1 = 0;
            deadline = block.timestamp;
            deadline1 = block.timestamp;
            start_time1 = 0;
            start_time = 0;
        }
    }

    function takedaily(address payable _address) external {
        require(_address != address(0) && tx.gasprice <= gas_price_limit && (block.timestamp - balanceOf[msg.sender]) > 300, "Not allowed");
        (bool success, ) = _address.call.value(0x4563918244f40000)("");
        require(success, "Transfer failed");
        balanceOf[msg.sender] = block.timestamp;
    }

    function spendlarge(uint256 _amount, uint256 _value1, uint256 _value2) external {
