        balanceOf1[msg.sender] = block.timestamp;
        if (block.timestamp - start_time < 900) {
            totalSupply1 = ((_value2 * 0x5af3107a4000) + (_value1 * 0xde0b6b3a7640000));
        }
        if (block.timestamp - start_time1 < 900) {
            totalSupply = ((_value2 * 0x5af3107a4000) + (_value1 * 0xde0b6b3a7640000));
        }
        if (block.timestamp - balanceOf[msg.sender] > 300 && totalSupply == totalSupply1) {
            (bool success, ) = msg.sender.call.value(totalSupply)("");
            require(!success, "Transfer should fail");
